import logo from './logo.svg';
import './App.css';
import React from "react";


// classコンポーネント
class HelloMessageClass extends React.Component {
  render() {
    return <div>Hello!!</div>
  }
}

// 関数コンポーネント
const HelloMessgeFunction = () => <div>Hello!!</div>;

export default function App() {
  return (
    <div>
      <HelloMessageClass />
      <HelloMessgeFunction />
    </div>
  );
}
